import './App.css';

function App() {
  return (
    <div className="App">
      <div class="intro">
        <div class="intro-left">
          <div class="name-section">
            <div class="name-text intro-text fade-in-text">Connor</div>
            <div class="name-text intro-text fade-in-text">Gilbert</div>
          </div>

          <div class="about-me-section fade-in-slow">
            <div class="about-me-body intro-text">I am a web developer with experience in react, html, css, javascript, and node.js</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
